    <div id= "page-landing">
     <div className="content-wraper">
        <img src={logoImg} alt="Happy"/>

        <main>

          <h1>Leve Felicidade Para o mundo</h1>
          <p>Visite orfanatos e mude o dia de muitas crianças.</p>
        </main>

        <div className= "Location"></div>
        <strong>Distrito Federal</strong>
        <span>Brasília</span>
     </div>

        <a href="" className></a>
    </div>
  );
}

export default App;
